class Solution {
    public int findChampion(int[][] grid) {
        int n = grid.length;

        for (int i = 0; i < n; i++) {
            boolean isChampion = true;

            for (int j = 0; j < n; j++) {
                if (i != j && grid[j][i] == 1) {
                    // If any team is stronger than team i, then team i is not the champion
                    isChampion = false;
                    break;
                }
            }

            if (isChampion) {
                // If no team is stronger than team i, then team i is the champion
                return i;
            }
        }

        // This line should theoretically never be reached because the problem
        // guarantees that there will be a champion.
        return -1;
    }
}
